import React from 'react';



class CustomerCare extends React.Component{
  render(){
    return(
      <div className="col-12 text-center customercare">
            <ul className="list-inline">
              <li className="list-inline-item"><a href="/home">Home</a></li>
              <li className="list-inline-item"><a href="/contact">Contact Us</a></li>
              <li  className="list-inline-item"><a href="/about">About Us</a></li>
              <li  className="list-inline-item"><a href="/review">Review</a></li>
            </ul>
        </div>
    )
  }
}
export default CustomerCare
